import logo from './logo.svg';
import './App.css';
import './BlogCards'

function App() {

  const mObjArr = [
    <BlogCards/>
  ]

  const blogCards = mObjArr.map((item)=>{ 
    return (
        <div className='BlogCard' key={item.id}>
          <h3>{item.title}</h3>
          <p>{item.description}</p>
        </div>
    )
  })

  return (
    <div className="App">
      {blogCards}
    </div>

  );
}

export default App;
